import React from "react";

import Header from "./Header";
import Footer from "./Footer";
import Home from "./Home";
import DrawStudio from "./DrawStudio";
import ShowAvailable from "./ShowAvailble";

import "../styles/layout.css"


type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    data: Object[]
}

const getData = async () => {
    const res = await fetch("http://10.18.243.73:3000/data")
    .then((res) => res.json())
    console.log(res)
}

const objects: Object[] = [
    { x: 50, y: 50, type: "chair" },
    { x: 150, y: 100, type: "table" },
    { x: 250, y: 150, type: "chair" },
    { x: 350, y: 200, type: "table" },
];


const DesktopLayout = ({props}: any) => {
    return (
        <>
            <Header />
            <div className="container_desktop">
                <div className="left_desktop">
                    <DrawStudio objects={objects}/> 
                    <div className="left_bottom">
                        <p>최근 업데이트 시점: {}</p>
                        <button> 새로고침 </button>
                    </div>
                </div>
                <div className="right_desktop">
                    <ShowAvailable objects={objects}/>
                </div>
            </div>
            <Footer />
        </>
    )
}

export default DesktopLayout
